[{"location":"man/basics/#Dataset","page":"Dataset","title":"Dataset","text":"","category":"section"},{"location":"man/basics/","page":"Dataset","title":"Dataset","text":"Para entrenar los modelos se utiliza un proceso de generación de Datasets. Este proceso consiste en grillar los datos obtenidos con cierta resolución espacial y temporal.  Posteriormente se binarizan y se ubican los clusters con mayor densidad de tormentas.  Luego de identificar los clusters con tormentas se toman parches tridimensionales con dimensiones especificadas.  Estos parches son escritos a disco en formato HDF5.","category":"page"},{"location":"man/basics/","page":"Dataset","title":"Dataset","text":"En este paquete se hace uso extensivo de ClimateBase.ClimArray.","category":"page"},{"location":"#NowcastingHuascaran.jl","page":"NowcastingHuascaran.jl","title":"NowcastingHuascaran.jl","text":"","category":"section"},{"location":"","page":"NowcastingHuascaran.jl","title":"NowcastingHuascaran.jl","text":"Proyecto Nowcasting Huascaran","category":"page"}]
